export class Config {

// tslint:disable-next-line:max-line-length
loader = 'data:image/gif;base64,'
imageLoader = 'data:image/gif;base64,';
noImage = ' data:image/png;base64,';

readonly shoeUrl = 'http://localhost:8081/shoes';
readonly itemURL = 'http://localhost:8081/items';
readonly imageURL = 'http://localhost:8081/images';
readonly loginURL = 'https://shop-secu.herokuapp.com/login';
readonly usersUrl = 'https://shop-secu.herokuapp.com/users';
readonly TOKEN_NAME = 'token';
readonly TOKEN_PREFIX = 'Bearer ';


readonly listOfCategories = [
  'Handbags & Wallets',
  'Clothing',
  'Shoes',
  'Fragrances',
  'Skin Care',
  'MakeUp',
  'Watches',
  'Jewelries'
];

readonly fragranceContent = ['5 ml', '10 ml', '15 ml', '30 ml', '40 ml', '50 ml', '60 ml', '70 ml', '75 ml', '90 ml',
    '100 ml', '110 ml', '115 ml', '125 ml', '150 ml', '175 ml', '200 ml'];

clothingSize: Array<any> = new Array<any>();

  constructor() {
    this.setClothingSize();
  }

  private setClothingSize() {
    ['S', 'M', 'L', 'XL', 'XXL', 'XXL'].forEach(x => this.clothingSize.push(x));
    let i: number;
    for (i = 30; i <= 60; i++)  {
      this.clothingSize.push(i);
    }
  }

  /*
  * Rewriting of function atob and btoa to avoid unicode problem such as accents etc
  */

  // rewriting of btoa encoder function
  utf8ToBase64(args: string) {
    return window.btoa(unescape(encodeURIComponent(args)));
  }

  // rwriting of atob unencoder function
  b64ToUtf8(args: string) {
    return decodeURIComponent(escape(window.atob(args)));
  }
}
